create database studenti
use studenti

create table sectii(cods smallint not null, denumires nvarchar(70) null, 
					constraint pksectii primary key (cods))

create table discipline(codd nvarchar(6) not null, denumired nvarchar(40) null, 
						constraint pkdiscipline primary key (codd))

create table planinv(cods smallint not null, codd nvarchar(6) not null, 
					constraint pkplaninv primary key (cods, codd))
alter table planinv add constraint fksectiiplaninv foreign key(cods) references sectii(cods)
alter table planinv add constraint fkdisciplineplaninv foreign key(codd) references discipline(codd)

create table studenti(cods smallint not null, nrmatricol nvarchar(10) not null,
					nume nvarchar(30) null, grupa nvarchar(10) null, datan datetime null, 
					constraint pkstudenti primary key (nrmatricol))
alter table studenti add constraint fksectiistudenti foreign key(cods) references sectii(cods)

create table rezultate(nrmatricol nvarchar(10) not null,
						disciplina nvarchar(6) not null,
						nota decimal(5, 2) not null)
alter table rezultate add constraint fkdisciplinerezultate foreign key(disciplina) references discipline(codd)
alter table rezultate add constraint fkstudentirezultate foreign key(nrmatricol) references studenti(nrmatricol)

 
 
 
 
